import React, { Component } from 'react';
import './App.css';
import Navigation from './Navigation.js';
import Header from './Header.js';
import Main from './Main.js';
import Sidebar from './Sidebar.js';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Navigation />
        <Header/>
        <Main/>
        <Sidebar/>
      </div>
    );
  }
}

export default App;
